import "./App.css";
import Home from "./components/Home";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route element={<Home />} path="/home" />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
